import Layout from "../layout/Layout";

import Testimonials from "../components/Testimonials";
import PageHeader from "../components/PageHeader";
import content from "../_data/content.json";

const dd = {
    "title" : "We are here"
};

const About = (dd) => (
  <Layout>
      <PageHeader data={dd} />
    <main>
      <Testimonials />
    </main>
  </Layout>
);

export default About;
